#
# The pattern is: "Binary Search on answer". Google that term to find more problems!
# In any case the idea is to try out integers 1, 2, 3, 4, 5, ... and for each integer,
# see if we can "slide through" the start array. If we overrun a range, then every
# integer above it is invalid. Binary Search helps to zero in on the integer faster.
# Versions 1 and 2 are more readable.
#
from typing import List

class Solution:
    def maxPossibleScore(self, start: List[int], d: int) -> int:
        N = len(start)
        start.sort()
        ans = -1
        left, right = 0, 10**20
        while left <= right:
            mid = (left + right) // 2
            p = start[0]
            ok = True
            for i in range(1, N):
                if start[i] <= p + mid <= start[i] + d:
                    p += mid
                elif p + mid <= start[i]:
                    p = start[i]
                else:
                    ok = False
                    break
            if ok:
                ans = mid
                left = mid + 1
            else:
                right = mid - 1
        return ans

